  background-color: ${colors().grey};
  min-height: 200px;
  padding: 30px 0;
`;

function Footer() {
  return (
    <Foot>
      <Container>
        <Title text="KONTAKT" color={colors().orange} size={44} />
        <p>
          Lorem ipsum dolor sit amet consectetur, adipisicing elit. Eum,
          quaerat?
        </p>
        <a href="tel:+48-730-173-031">kontakt</a>
      </Container>
    </Foot>
  );
}

export default Footer;
